(function($){$(function(){$(document).on("click",".wpide-wp-rate-notice a[data-rate-action]",function(evt){let notice=$(this).closest(".wpide-wp-rate-notice");let rateAction=$(this).attr("data-rate-action");let container=$(this).closest(".nk-notification-item");if(container.length){let index=container.index();let event=new CustomEvent("wpide_notice_removed",{detail:index});document.body.dispatchEvent(event)}else{container=$(this).closest(".wpide-rating-notice");container.slideUp(function(){$(this).remove()})}evt.preventDefault();$.post(ajaxurl,{action:notice.attr("data-action"),rate_action:rateAction,_nonce:notice.attr("data-nonce")}).fail(function(error){console.log(error)})})})})(jQuery);